function (inputData, outputData, state) {
  const { value, wait } = inputData;
  const { result } = outputData;

  const timer = state.get('timer');
  if (timer) {
    clearTimeout(timer);
  }

  const newTimer = setTimeout(() => {
    result.next(value);
  }, wait);

  state.set('timer', newTimer);

  state.onCleanup(() => {
    clearTimeout(timer);
  });
}
